import React, { useState} from 'react';
import './prev.css';
import {Button} from '@mui/material';
import Snackbar, { SnackbarOrigin } from '@mui/material/Snackbar';
import { TableBody, TableCell, TableRow, TableHead, TableContainer, Table } from '@mui/material';
import CloseIcon from '@mui/icons-material/Close';
// import {multiStepContext} from '../stepcontext/StepContext';



export default function Preview() {
    const handleClose = (event: React.SyntheticEvent | Event, reason?: string) => {
        if (reason === 'clickaway') {
          return;
        }
        setOpen(false);
      };
  
//   const {finalData} = useContext(multiStepContext);


  return (
    <>
    <div className='preview'>
    <Snackbar
                    open={true}
                    autoHideDuration={60}
                    sx={{ height: "0%" }}
                        anchorOrigin={{
                            vertical: "top",
                            horizontal: "center"
                            
                        }}
                    
                    // onClose={handleClose}
                    // anchorOrigin={{ vertical, horizontal }}
                    // key = {vertical + horizontal}
                    position ="top"
                    message="Workout is added successfully"/>
                    {/* <i class="xmark-large add-btn" title = "close"></i> */}
        <div className='workoutdata'>
            <h1>Workout Preview</h1>
        

        </div>
        
      
    </div>
    <div>
      <TableContainer>
        <Table border='1' style={{display:'flex', justifyContent:'center'}}>
            <TableHead>
                <TableRow style={{backgroundColor:'burlywood', color:'aliceblue'}}>
                    <TableCell>Exercise Name</TableCell>
                    <TableCell>Sets</TableCell>
                    <TableCell>Reps</TableCell>
                    <TableCell>Unit</TableCell>
                    <TableCell>Date</TableCell>
                    
                    
                </TableRow>
            </TableHead>
            {/* <TableBody>
                {finalData.map((data) =>(
                    <TableRow key = {data.email}>
                        <TableCell>{data.exercisename}</TableCell>
                        <TableCell>{data.sets}</TableCell>
                        <TableCell>{data.reps}</TableCell>
                        <TableCell>{data.units}</TableCell>
                        <TableCell>{data.date}</TableCell>
                       
                        
                    </TableRow>
                ))}
            </TableBody> */}
        </Table>
      </TableContainer>
    </div>
    </>
  )
}
